// Libs
import React from "react";
import PropTypes from "prop-types";
import classnames from "classnames";

export function Loader({ className }) {
    const rootClassName = classnames("brain-c-loader", className);

    return (
        <div className={rootClassName}>
            <div className="brain-c-loader__ball brain-c-loader__a" />
            <div className="brain-c-loader__ball brain-c-loader__b" />
            <div className="brain-c-loader__ball brain-c-loader__c" />
        </div>
    );
}

Loader.propTypes = {
    /**
     * Additional className for loader
     */
    className: PropTypes.string,
};
